import React from "react";
import "./css/Footer.css";
import AdminLogin from "./AdminLogin";

export default function Footer() {

    return (
        <div className="Footer-wrapper">
            <div>
                @2021 Lorianne Aguilar
            </div>
            <div>
                <a href="#" target="new"><img src="./img/github.svg" alt="Github" /></a>
                <a href="#" target="new"><img src="./img/linkedin.svg" alt="Linkedin" /></a>
                <a href="#" target="new"><img src="./img/instagram.svg" alt="Instagram" /></a>
            </div>
            <div>
                <AdminLogin />
            </div>
        </div>

    )
};
